@jen_jstephen “I know what people want to hear… Pip talking about dead birds in an attic.”
“Add Rex in there?”
“Bingo!” #TheArchers 🐧🐦🐤

@Icelass @lesfisher6 ‘It fought two world wars’ ✅✅✅✅
‘Marmite based recipe for cake lovers’ ❌❌❌❌
But, yes... RECORD 😁😁😁😁

@Toriaclaire Good morning everybody.
I’m a teacher in a special school in Norfolk.
Nice to meet you. 🙂 #TinyVoiceTalks

10 years ago I let #TheArchers into my life. In the ensuing decade I have been happy, sad, amused, bored, excited, dumbfounded and just plain speechless in equal measure.
And I wouldn’t change it for the world.
@BBCTheArchers @BBCRadio4 #TheArchers70 🐔🐴🐮🐏
